    public function getData()
    {
        try {
            $data = \DB::table('noti_voca_verb')->select('word', 'read', 'mean')->get();

            return response([
                'status' => 'success',
                'data'   => $data
            ], 200);
        } catch (Exception $e) {
            return response([
                'status' => 'failed',
                'msg' => $e->getMessage()
            ], 204);
        }
    }

    public function getTmp()
    {
    	$stri = file_get_contents('./textv.txt');
    	$row = explode(PHP_EOL, $stri);
    	// var_dump($lines);exit;
    	// $row = str_getcsv($stri, "\r\n");
		$length = count($row);
		// print_r($row);exit;
		// var_dump($length); exit;
		$arr = ['title' => [], 'time' => []];
		for($i=0;$i<$length;$i++) {
			// print_r($row[$i]);exit;
			if (strpos($row[$i], '</span></div><div class=') !== false) {
			    $arr['title'][] = static::delete_all_between('>', '</span></div><div class=', $row[$i]);
			}
			else if ((strpos($row[$i], '</span></div></div>') !== false)&&(strpos($row[$i], ':') !== false)) {
			    $arr['time'][] = static::delete_all_between('>', '</span></div></div>', $row[$i]);
			}
		}
		var_dump($arr); exit;
    }

   static function delete_all_between($beginning, $end, $string) {
  $beginningPos = strpos($string, $beginning);
  $endPos = strpos($string, $end);
  if ($beginningPos === false || $endPos === false) {
    return $string;
  }

  $textToDelete = substr($string, $beginningPos, ($endPos + strlen($end)) - $beginningPos);
  // print_r($string);
  // print_r($textToDelete);

  return $textToDelete;
}
